window.bookSummaryJSON = "<p>From <i>New York Times</i> best-selling authors Amie Kaufman and Jay Kristoff comes an Illuminae prequel novella that gives listeners a hair-raising glimpse into the calamity that befell the invincible AI system known as AIDAN - and the daring young programmer who would risk her life to keep it from crashing. </p> <p><b>AIDAN is the AI you'll love to hate. </b></p> <p>The advanced AI system was supposed to protect a fleet of survivors who'd escaped the deadly attack on Kerenza IV. AIDAN was supposed to be infallible. But in the chaotic weeks and months that followed, it became clear that something was terribly, terribly wrong with AIDAN....</p> <p>Narrators:</p> <p>\"Olivia Klein\", read by India Dupr√© </p> <p>\"Ethan Wolf\", read by James Fouhey </p> <p>\"AIDAN\", read by Lincoln Hoppe </p> <p>\"Stephanie LeFevre\", read by Emma Bering </p> <p>\"Ezra Mason\", read by Johnathan McClain </p> <p>Narrator, read by Ryan Gesell </p> <p>Featuring additional performances by Danny Campbell, Frankie Corzo, Chris Cuilla, Deepti Gupta, John Lee, Sarah Mollo-Christensen, Donabella Mortel, Austin Rising, Erin Spencer, and Nancy Wu. </p>"; 
